    {title:'Best tutorial for learning react',body:'lorem ipsum...', author:'Camio',id:3},
  ]);


  const handleDelete=(id)=>{
  const newBlogs= blogs.filter(blog => blog.id !== id)
  setBlogs(newBlogs)
  }

